taja poolt vastavale vormi-sildiga loodud sisendväljale sisestatud väärtust.','A form-tag is a short code enclosed in square brackets used in a form content. A form-tag generally represents an input field, and its components can be separated into four parts: type, name, options, and values. Contact Form 7 supports several types of form-tags including text fields, number fields, date fields, checkboxes, radio buttons, menus, file-uploading fields, CAPTCHAs, and quiz fields.'=>'Vormi-silt on nurksulgudega ümbritsetud lühike kood, mida kasutatakse vormi sisus. Üldjuhul sümboliseerib vormi-silt sisendvälja ning tema komponendid saab jaotada nelja osasse: tüüp, nimi, valikud ja väärtused. Contact Form 7 toetab mitut tüüpi vormi-silte, sealhulgas tekstiväljad, numbriväljad, kuupäeva väljad, valikkastid, raadionupud, menüüd, failide üleslaadimise väljad, TURVAKOODid ja küsimustiku väljad.','<strong>Additional Settings</strong> provides a place where you can customize the behavior of this contact form by adding code snippets.'=>'<strong>Lisaseaded</strong> annavad koha, kus saab selle kontaktivormi käitumist kohandada koodijuppide abil.','In <strong>Messages</strong>, you can edit various types of messages used for this contact form. These messages are relatively short messages, like a validation error message you see when you leave a required field blank.'=>'<strong>Sõnumites</strong> saad muuta erinevaid selle kontaktivormi poolt kasutatavaid teateid. Need sõnumid on üsna lühikesed, näiteks valideerimise veateade, mida näeb siis, kui nõutud väli jäeti tühjaks.','<strong>Mail (2)</strong> is an additional mail template that works similar to Mail. Mail (2) is different in that it is sent only when Mail has been sent successfully.'=>'<strong>E-kiri (2)</strong> on lisamall, mis töötab sarnaselt E-kirjale. Erinevus on selles, et E-kiri (2) saadetakse vaid siis, kui E-kiri on edukalt saadetud.','<strong>Mail</strong> manages a mail template (headers and message body) that this contact form will send when users submit it. You can use Contact Form 7&#8217;s mail-tags here.'=>'<strong>E-kiri</strong> on koht e-kirja malli halduseks (päis ja sõnumi sisu), mille see kontaktivorm saadab peale kasutajapoolset sõnumi teelesaatmist. Siin saad kasutada Contact Form 7-me e-kirja-silte.','<strong>Form</strong> is a content of HTML form. You can use arbitrary HTML, which is allowed inside a form element. You can also use Contact Form 7&#8217;s form-tags here.'=>'<strong>Vorm</strong> on HTML vormi sisu. Võid kasutada suvalist HTML-i, mis on vormielemendi sees lubatud. Siin võid kasutada ka Contact Form 7-me vormi-silte.','<strong>Title</strong> is the title of a contact form. This title is only used for labeling a contact form, and can be edited.'=>'<strong>Pealkiri</strong> on kontaktivormi pealkiri. Seda pealkirja kasutatakse ainult kontaktivormi nimesildina ning seda saab muuta.','On this screen, you can edit a contact form. A contact form is comprised of the following components:'=>'Siin vaates saad kontaktivormi muuta. Kontaktivorm koosneb järgnevatest komponentidest:','<strong>Duplicate</strong> - Clones that contact form. A cloned contact form inherits all content from the original, but has a different ID.'=>'<strong>Loo duplikaat</strong> - kloonib kontaktivormi. Kloonitud kontaktivormil on sama sisu, mis originaalil, kuid erinev ID.','<strong>Edit</strong> - Navigates to the editing screen for that contact form. You can also reach that screen by clicking on the contact form title.'=>'<strong>Muuda</strong> - viib selle kontaktivormi muutmise vaatesse. Selle vaateni jõuab ka kontaktivormi pealkirjal klõpsates.','Hovering over a row in the contact forms list will display action links that allow you to manage your contact form. You can perform the following actions:'=>'Kontaktivormis hiirt rea kohal hoides näed tegevuslinke oma kontaktivormide haldamiseks. Saad teha järgnevaid toiminguid:','On this screen, you can manage contact forms provided 